import logo from "../public/icon_btoshi.png";
import "./App.css";

function App() {
	return (
		<div className="App">
			<header className="App-header">
				<img src="icon_btoshi.png" className="App-logo" alt="logo" />
			</header>
		</div>
	);
}

export default App;
